import React from 'react';
import { FaArrowLeft } from 'react-icons/fa';
import ImgMicrosoft from '../../assets/images/microsoft.png';

import Footer from '../../components/footer';
import HeaderEmpresa from '../../components/headerEmpresa';
import Input from '../../components/inputs/index';
import FotoAviso from '../../assets/images/Aviso.svg'


import '../../global.css';
import './style.css';


function PerfilEmpresa() {
    return (
        <div>
            <HeaderEmpresa />
            <div className="arrow">
                <FaArrowLeft color="white" size={24} />
            </div>

            <h1>Seu perfil</h1>
            <h1>Suas vagas</h1>

            <div className="image">
                <img src={ImgMicrosoft} alt="imagem da empresa" />
                <p>Editar foto</p>
            </div>

            <div className="tabela">

                <h1>Seus dados</h1>
                <Input label="Nome fantasia" name="nomeFantasia" />
                <Input label="CNAE" name="cnae" />
                <Input label="Whatsapp" name="whatsapp" />
                <Input label="Razão social" name="razaosocial" />

                <h1>Seu endereço</h1>
                <Input label="CEP" name="cep" />
                <Input label="Bairro" name="bairro" />
                <Input label="Rua" name="rua" />
                <Input label="Número" name="numero" />
                <Input label="Estado" name="estado" />
                <Input label="Cidade" name="cidade" />

            </div>

                <img src={FotoAviso} alt="aviso"/>
            <Footer />
        </div>
    );
}

export default PerfilEmpresa;
